import React from 'react'
import PetShop from './PetShop'

function App () {

    const handleClick = () => {
        console.log('Iniciar banho')
    }

    return (
        <PetShop
            dogs={2}
            customerName="Ricardo"
            onClick={handleClick}
            status='Completed'
        />
    )
}

export default App
